import React, { Component } from 'react';
//import Instruction from '../components/instruction';
//import Valuation from '../components/valuation';
import { Navbar, Nav } from 'react-bootstrap';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {
            current: null
        };

        this.instructionOnClick = this.instructionOnClick.bind(this);
    }

    instructionOnClick() {
        return <Instruction />
    }


    valuationOnClick() {
        return <Valuation />
    }

    render() {

        return (
            <React.Fragment>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>BOND PRICING</Navbar.Brand>
                    <Nav.Link href="/instruction" onClick={this.instructionOnClick}>Instruction</Nav.Link>
                    <Nav.Link href="/valuation">Valuation</Nav.Link>
                </Navbar>
            </React.Fragment>
        )
    }
}

export default Navigation;
